import React from "react";
import Starter from "./Starter";
import Package from "./Package";

const Pricing = () =>{
    
    return(
        <section className="Pricing_features">
        <div className="container">
        <Starter 
                starter_heading="Pricing plan"
                starter_heading_2 = "Pricing plan"
            />
        <div className="row ">
        <Package 
            check={check}
            bgColor = {bgWhite}
            blur ={blur}
        />
        <Package 
            check={check}
            bgColor = {bgBlue}
            blur ={blur}
        />
        <Package 
            check={check}
            bgColor = {bgWhite}
            blur ={blur}
        />


        </div>
        </div>
        

        </section>

    )
}

export default Pricing;
